import React from 'react';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import Divider from '@mui/material/Divider';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';
import FaceIcon from '@mui/icons-material/Face';
import FacebookIcon from '@mui/icons-material/Facebook';
import TikTokIcon from '@mui/icons-material/MusicNote'; // Assuming TikTok uses a music note icon
import ThreadsIcon from '@mui/icons-material/Chat'; // Assuming Threads uses a chat icon
import WebTrafficIcon from '@mui/icons-material/Public'; // Assuming web traffic uses a globe icon

function SidebBr() {
  return (
    <Drawer
      variant="permanent"
      anchor="left"
    >
      <List>
        {['Top Stocks', 'Data Bits', 'Reddit Mentions', 'News Mentions', '4chan Mentions', 'Instagram Followers', 'Facebook Followers', 'TikTok Followers', 'Threads Followers', 'Webpage Traffic'].map((text, index) => (
          <ListItem button key={text}>
            <ListItemIcon>
              {index === 0 ? <InboxIcon /> :
               index === 1 ? <MailIcon /> :
               index === 2 ? <FaceIcon /> :
               index === 3 ? <InboxIcon /> :
               index === 4 ? <FaceIcon /> :
               index === 5 ? <FaceIcon /> :
               index === 6 ? <FacebookIcon /> :
               index === 7 ? <TikTokIcon /> :
               index === 8 ? <ThreadsIcon /> :
               <WebTrafficIcon />}
            </ListItemIcon>
            <ListItemText primary={text} />
          </ListItem>
        ))}
      </List>
      <Divider />
    </Drawer>
  );
}

export default Sidebar;
